import React from 'react';
import CategoryItem from 'CategoryItem'

function CategoryList({categories}) {
    let catKey = 0;
    return(
        <select>
            {
                categories.map(category => {
                    return <CategoryItem key={catKey + 1}/>
                })
            }
        </select>
    )
}

export default CategoryList;
